          "id": "63734105d31ab6019461319dc49e42b6a9579c15",
          "message": "relax relative tolerance for lm-eval (#47)\n\nSUMMARY:\r\n\r\nthe observation is that on gcp-k8s-l4-duo instances, the gsm8k task\r\nmetric values have a wider range than seen on gcp-k8s-l4-solo instances.\r\ntemporarily relax the tolerance for the `isclose` check until we\r\nimplement custom settings.\r\n\r\nTEST PLAN:\r\nusing results from various runs yesterday and today, I calculated the\r\nRTOL necessary to get the measured value of any metric to fall w/in a\r\ntolerance of the ground truth. 0.040 was enough to capture the widest\r\ndifference.",
